var slicee = noMba.FirstFunction.BasicBlocks.Single().LastInstruction.GetOperand(0);
var fromLlvm = LLVMToAst.ToAst(slicee, 64, (LLVMValueRef x) =>
{
    var text = x.ToString();
    if (text == "i64 %0")
        return new VarNode("a", 64);
    else if (text == "i64 %0")
        return new VarNode("d", 64);
    else if (text == "i64 %1")
        return new VarNode("b", 64);
    else if (text == "i64 %2")
        return new VarNode("c", 64);
    else if (text == "i64 %3")
        return new VarNode("e", 64);
    else if (text == "i64 %4")
        return new VarNode("y", 64);
    else
        throw new InvalidOperationException();
});

